import { Outlet, Link } from "react-router-dom";
import {useEffect, useState} from "react";

function ListeEnchere() {
    const [list,setList] = useState(null);
    useEffect(() => {
        fetch("http://localhost:8000/enchere/cli/Reload_acccount")
            .then((response) => response.json())
            .then((data) => {
                setList(data.data);
            })
            .catch((error) => {
                console.error(error);
            });
    }, []);
    return (
        <>
            <div className="container">
                <h1>Liste des Encheres</h1>
                <table className="table">
                    <thead>
                    <tr>
                        <td>Date Encheres</td>
                        <td>idEnchere</td>
                        <td>categorie</td>
                        <td>Duree</td>
                        <td></td>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <Value date="2023-05-03" id={12} prod="sdhsbh" duree={2} />
                    </tr>
                    </tbody>
                </table>
            </div>
            <Outlet/>
        </>
    );
}

const Value = (props) => {
    return (
        <>
            <td>{props.date}</td>
            <td>{props.id}</td>
            <td>{props.prod}</td>
            <td>{props.duree}h</td>
            <td><Link to="/FicheEnchere">DÃ©tail</Link></td>
        </>
    );
}


export default ListeEnchere;
